import axios from 'axios';

const API_URL = 'http://localhost:8000/api';

const api = axios.create({
  baseURL: API_URL,
  headers: {
    'Content-Type': 'application/json',
  },
});

// Add a request interceptor to add the auth token to requests
api.interceptors.request.use(
  (config) => {
    const token = localStorage.getItem('token');
    if (token) {
      config.headers.Authorization = `Bearer ${token}`;
    }
    return config;
  },
  (error) => {
    return Promise.reject(error);
  }
);

// Add a response interceptor to handle token refresh
api.interceptors.response.use(
  (response) => response,
  async (error) => {
    const originalRequest = error.config;
    if (error.response.status === 401 && !originalRequest._retry) {
      originalRequest._retry = true;
      try {
        const refreshToken = localStorage.getItem('refreshToken');
        if (refreshToken) {
          const response = await axios.post(`${API_URL}/auth/token/refresh/`, {
            refresh: refreshToken,
          });
          if (response.data.access) {
            localStorage.setItem('token', response.data.access);
            api.defaults.headers.common['Authorization'] = `Bearer ${response.data.access}`;
            return api(originalRequest);
          }
        }
      } catch (refreshError) {
        // If refresh fails, clear tokens and redirect to login
        localStorage.removeItem('token');
        localStorage.removeItem('refreshToken');
        window.location.href = '/login';
      }
    }
    return Promise.reject(error);
  }
);

export const auth = {
  register: async (username, email, password, role, firstName = '', lastName = '') => {
    try {
      const response = await api.post('/auth/register/', {
        username,
        email,
        password,
        role,
        first_name: firstName,
        last_name: lastName,
      });
      if (response.data.access) {
        localStorage.setItem('token', response.data.access);
      }
      if (response.data.refresh) {
        localStorage.setItem('refreshToken', response.data.refresh);
      }
      return response.data;
    } catch (error) {
      throw error.response?.data || { detail: 'Registration failed. Please try again.' };
    }
  },

  login: async (username, password) => {
    try {
      const response = await api.post('/auth/login/', {
        username,
        password,
      });

      // Store tokens if login is successful
      if (response.data.access) {
        localStorage.setItem('token', response.data.access);
      }
      if (response.data.refresh) {
        localStorage.setItem('refreshToken', response.data.refresh);
      }

      return response.data;
    } catch (error) {
      if (error.response?.status === 401) {
        throw { detail: 'Invalid username or password' };
      }
      throw error.response?.data || { detail: 'An error occurred during login' };
    }
  },

  logout: () => {
    localStorage.removeItem('token');
    localStorage.removeItem('refreshToken');
  },

  getCurrentUser: async () => {
    try {
      const response = await api.get('/auth/profile/');
      return response.data;
    } catch (error) {
      throw error.response?.data || { detail: 'Failed to get user profile' };
    }
  },
};

export const resume = {
  upload: async (file) => {
    try {
      const formData = new FormData();
      formData.append('resume', file);
      const response = await api.post('/resumes/upload/', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      return response.data;
    } catch (error) {
      throw error.response?.data || error.message;
    }
  },

  getAnalysis: async (resumeId) => {
    try {
      const response = await api.get(`/resumes/${resumeId}/analysis/`);
      return response.data;
    } catch (error) {
      throw error.response?.data || error.message;
    }
  },
};

export const jobs = {
  getJobListings: async (filters = {}) => {
    try {
      const response = await api.get('/jobs/listings/', { params: filters });
      return response.data;
    } catch (error) {
      console.error('Error fetching jobs:', error);
      throw error.response?.data || { detail: 'Failed to fetch job listings' };
    }
  },

  getJobDetails: async (jobId) => {
    try {
      const response = await api.get(`/jobs/listings/${jobId}/`);
      return response.data;
    } catch (error) {
      console.error('Error fetching job details:', error);
      throw error.response?.data || { detail: 'Failed to fetch job details' };
    }
  },

  applyToJob: async (jobId, resumeId, coverLetter = '') => {
    try {
      const response = await api.post(`/jobs/listings/${jobId}/apply/`, {
        resume: resumeId,
        cover_letter: coverLetter
      });
      return response.data;
    } catch (error) {
      console.error('Error applying to job:', error);
      throw error.response?.data || { detail: 'Failed to apply to job' };
    }
  }
};

export const profile = {
  update: async (userData) => {
    try {
      const response = await api.put('/auth/profile/', userData);
      return response.data;
    } catch (error) {
      throw error.response?.data || error.message;
    }
  },

  changePassword: async (currentPassword, newPassword) => {
    try {
      const response = await api.post('/auth/password-reset/confirm/', {
        current_password: currentPassword,
        new_password: newPassword,
      });
      return response.data;
    } catch (error) {
      throw error.response?.data || error.message;
    }
  },
};

export const resumes = {
  uploadResume: async (formData) => {
    try {
      const response = await api.post('/resumes/', formData, {
        headers: {
          'Content-Type': 'multipart/form-data',
        },
      });
      return response.data;
    } catch (error) {
      console.error('Error uploading resume:', error);
      throw error.response?.data || { detail: 'Failed to upload resume' };
    }
  },

  getResumes: async () => {
    try {
      const response = await api.get('/resumes/');
      return response.data;
    } catch (error) {
      console.error('Error fetching resumes:', error);
      throw error.response?.data || { detail: 'Failed to fetch resumes' };
    }
  },

  getResumeAnalysis: async (resumeId) => {
    try {
      const response = await api.get(`/resumes/${resumeId}/analysis/`);
      return response.data;
    } catch (error) {
      console.error('Error fetching resume analysis:', error);
      throw error.response?.data || { detail: 'Failed to fetch resume analysis' };
    }
  }
};

export default api;
